import React, { useState } from "react";

const App = () => {
  const [components, setComponents] = useState([]);

  // Function to add a button to the mobile frame
  const addButton = () => {
    setComponents([
      ...components,
      <button className="regular-button" key={components.length}>
        Click Me
      </button>
    ]);
  };

  return (
    <div className="app">
      <div className="sidebar">
        <div className="draggable-item" onClick={addButton}>
          Add Button
        </div>
      </div>

      <div className="main-content">
        <div className="mobile-frame">
          <div className="mobile-content">
            {components}
          </div>
        </div>
      </div>
    </div>
  );
};

export default App;
